  \"the-use-of-copper-river-salmon-and-other-wild-resources-by-upper-tanana-communities-1983-1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"At its February 1984 meeting, the Alaska
  Board of Fisheries determined that the uses of Copper River salmon by residents
  of Dot Lake qualified as subsistence uses. The Board also determined that the uses
  of Copper River salmon by residents of four additional Upper Tanana communities
  (Northway, Tanacross, Tetlin, and Tok) probably were subsistence uses, based on
  limited information showing their similarities to uses at Dot Lake. Data presented
  in this report indicate that residents of Tanacross, Tetlin, Northway, and Tok actively
  harvest a variety of wild resources throughout the year. The harvest of Copper River
  salmon is a common activity during the summer months and has occurred for many years.
  Copper River salmon is used by many households and contributes significantly to
  the diet. Additionally, the use of Copper River salmon has cultural and social meaning
  to families in all Upper Tanana communities.\",\n\t\"license_title\": \"License
